const mongodb = require('mongodb')


class DBClient{
	constructor(){
		let host = 'localhost'
		let port = '27017'
		let database = 'files_manager'
		if (process.env.DB_HOST) host = process.env.DB_HOST
		if (process.env.DB_PORT) port = process.env.DB_PORT
